const catalogo = document.getElementById('catalogo');
const inputBusqueda = document.getElementById('busqueda');

// Renderiza productos según lista recibida
function renderizarProductos(lista) {
  catalogo.innerHTML = '';
  lista.forEach((p, index) => {
    catalogo.innerHTML += `
      <div class="col">
        <div class="card h-100">
          <img src="${p.imagen}" class="card-img-top" alt="${p.nombre}">
          <div class="card-body">
            <h5 class="card-title">${p.nombre}</h5>
            <p class="card-text">${p.descripcion}</p>
            <p class="price">₡${p.precio.toLocaleString()}</p>
            <p class="decant">5ml: ₡${p.decant5ml} | 10ml: ₡${p.decant10ml} | 2ml: ₡${p.decant2ml}</p>

            <select class="form-select mb-2" id="opcion-${index}">
              <option value="completo">Frasco completo (₡${p.precio})</option>
              <option value="5ml">Decant 5ml (₡${p.decant5ml})</option>
              <option value="10ml">Decant 10ml (₡${p.decant10ml})</option>
              <option value="2ml">Decant 2ml (₡${p.decant2ml})</option>
            </select>

            <button class="btn btn-primary w-100" onclick='agregarAlCarrito(${JSON.stringify(p)}, "opcion-${index}")'>
              Agregar al carrito
            </button>
          </div>
        </div>
      </div>
    `;
  });
}

// Agregar producto con tipo
function agregarAlCarrito(producto, selectId) {
  const opcion = document.getElementById(selectId).value;
  let itemCarrito;

  if (opcion === 'completo') {
    itemCarrito = {
      nombre: producto.nombre + " (Completo)",
      precio: producto.precio,
      imagen: producto.imagen,
      descripcion: producto.descripcion
    };
  } else {
    const precio = producto[`decant${opcion}`];
    itemCarrito = {
      nombre: `${producto.nombre} (${opcion})`,
      precio: precio,
      imagen: producto.imagen,
      descripcion: producto.descripcion
    };
  }

  let carrito = JSON.parse(localStorage.getItem('carrito')) || [];
  carrito.push(itemCarrito);
  localStorage.setItem('carrito', JSON.stringify(carrito));
  actualizarContador();

  Swal.fire({
    icon: 'success',
    title: '¡Agregado al carrito!',
    text: itemCarrito.nombre,
    timer: 1500,
    showConfirmButton: false,
    toast: true,
    position: 'top-end'
  });
}

// Actualiza contador
function actualizarContador() {
  const carrito = JSON.parse(localStorage.getItem('carrito')) || [];
  const contador = document.getElementById('cart-count');
  if (contador) {
    contador.textContent = carrito.length;
  }
}

// Buscar por nombre
inputBusqueda.addEventListener('input', function () {
  const texto = this.value.toLowerCase();
  const filtrados = productos.filter(p =>
    p.nombre.toLowerCase().includes(texto)
  );
  renderizarProductos(filtrados);
});

// Al cargar la página
document.addEventListener('DOMContentLoaded', () => {
  actualizarContador();
  renderizarProductos(productos);
});